import style from "./Landing.module.css";
import { Link } from "react-router-dom";

const Landing = () => {
  return (
    <div className={style.screen}>
      <div className={style.container}>
        <h2 className={style.make}> HENRY </h2>
        <h1 className={style.title}> SEARCH YOUR ACTIVITY </h1>
        
      </div>
      <footer><Link to="/home">
          <button className={style.button}> Welcome </button>
        </Link></footer>
    </div>

    // <div name="landing" className="w-full h-screen">
    //   <div className="max-w-[1000px] mx-auto px-8 flex flex-col justify-center h-full">
    //     <h2 className="flex items-center top-1 left-1"> HuntTravel </h2>
    //     <h1 className="top-5"> SEARCH YOUR ACTIVITY </h1>
    //     <Link to="/home">
    //       <button className="text-white top-6 border-2 px-6 py-3 my-2 flex items-center hover:bg-[#87581a] hover:border-[#87581a]"> Welcome </button>
    //     </Link>
    //   </div>
    // </div>
  );
};

export default Landing;
